import './moviecard.css';
import React from 'react'

const Moviecard = (Props) => {
  const {movie}=Props;
  return (
    <div className='card'>
      <div className='movie-img'>
        <img src={movie.Poster} alt="" />
      </div>
      <div className='movie-information'>
        <h3>{}</h3>
      </div>
    </div>
  )
}

export default Moviecard
